import style from "./Courses.module.css";
import React from "react";
import { useState } from "react";

function CoursesCreate(props) {
  const [courseName, setCourseName] = useState("");
  if (props.state.courses.courses.length === 0) {
    return (
      <div className={style.container}>
        <div>Courses page is empty</div>
        <input
          value={courseName}
          onInput={(evt) => setCourseName(evt.target.value)}
          type="text"
          placeholder="Course Name"
        />
        <button onClick={props.createCourse({ courseName })}>Create</button>
      </div>
    );
  }
  return (
    <div className={style.container}>
      <div>
        {props.state.courses.courses.map((p) => (
          <div key={p.id}> </div>
        ))}
        <input
          value={courseName}
          onInput={(evt) => setCourseName(evt.target.value)}
          type="text"
          placeholder="Course Name"
        />
        <button onClick={props.createCourse({ courseName })}>Create</button>
      </div>
    </div>
  );
}
export default CoursesCreate;
